import React from 'react';
import ReactDOM from 'react-dom';
import TodoSearch from "./to-do-search/todo-serach";
import TodoStatusFilter from "./todo-status-filter/to-status-filter";
import TodoList from "./to-do-list/to-do-list";



const TodolistItem = ({label}) => {
    return (
        <span>{label}</span>
    )
}

const TodoHeader = () => {
    return (
        <div>
            <TodoSearch />
            <TodoStatusFilter />
        </div>
    )
};

const App  = () => {
    const todos = [
        {id: 1,label: 'Drink Coffee',done: false,important: false},
        {id: 2,label: 'Lear React',done: false,important: false},
        {id: 3,label: 'Drink vodka',done: false,important: false},
        {id: 4,label: 'Drink cola',done: false,important: false},

    ]
    return (
        <div className={'wrapper'}>
            <TodoHeader />
            <TodoList todos={todos}/>
        </div>
    )
}
ReactDOM.render(<App />,document.getElementById('root'));
